        async function getEmbedding(text) {
            const url = "https://api.openai.com/v1/embeddings";
            const response = await fetch(url, {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                    "Authorization": `Bearer ${OPENAI_API_KEY}`
                },
                body: JSON.stringify({
                    input: text,
                    model: "text-embedding-ada-002"
                })
            });
            const data = await response.json();
            console.log(data)
            await cosineSimilarity(data.data[0].embedding)
        }


        function cosineSimilarity(qe) {
            let dotProduct = 0;
            let magnitudeA = 0;
            let magnitudeB = 0;
            console.log(data.length)
            for (let l = 0; l < data.length; l++) {
                for (let i = 0; i < data[0].length; i++) {
                    dotProduct += data[l][i] * qe[i];
                    magnitudeA += data[l][i] * data[l][i];
                    magnitudeB += qe[i] * qe[i];
                }
                magnitudeA = Math.sqrt(magnitudeA);
                magnitudeB = Math.sqrt(magnitudeB);
                console.log(dotProduct / (magnitudeA * magnitudeB))
                document.querySelector("p").textContent = dotProduct / (magnitudeA * magnitudeB)+"\n";
                similarity.push(dotProduct / (magnitudeA * magnitudeB));
                dotProduct = 0;
                magnitudeA = 0;
                magnitudeB = 0;
            }
            console.log(similarity)
            let result = similarity.map((value, index) => [index, value]);
            result.sort((a, b) => b[1] - a[1]);
            let top2 = result.slice(0, 2).map(item=>item[0]);
            console.log(top2)
            top2=[],similarity=[]
        }
    </script>
